import React from 'react';
import { Row, Col, Container } from 'reactstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLink, faMapMarker, faBolt } from "@fortawesome/free-solid-svg-icons";
import { faGithub } from "@fortawesome/free-brands-svg-icons";
import { library } from '@fortawesome/fontawesome-svg-core'

library.add(faLink, faBolt, faGithub, faMapMarker);

export default class Contact extends React.Component {

    render() {
        return(
            <Row style={{display:'flex', alignItems:'center'}}>
                <Container fluid>
                    <FontAwesomeIcon icon="bolt" size="3x"/>
                </Container>
                <Container fluid>
                     <h2> hoang vu </h2>
                     <br/><br/>
                </Container>
                <Container fluid>
                    <a href="https://github.com/hoangvu01">
                        <h4> <FontAwesomeIcon icon={['fab', "github"]}/> hoangvu01 </h4>
                    </a>            
                </Container>
                <Container fluid>
                    <a href="https://hoangvu01.github.io">
                        <h4> <FontAwesomeIcon icon="link"/> hoangvu01.github.io </h4>
                    </a>
                </Container>
                <Container fluid>
                    <h4> <FontAwesomeIcon icon='map-marker'/> London, United Kingdom </h4>
                </Container>
                <Container fluid>
                    <a href="https://hoangvu01.github.io">
                        <h4> <FontAwesomeIcon icon="link"/> hoangvu01.github.io </h4>
                    </a>
                </Container>
            </Row>
        )
    }
}
